import React from "react";
import MenuItem from "./MenuItem";

function MenuList({ menus }) {
  return (
    <div>
      <AvaMenu />
      <Filter />
      {menus.map((menu) => (
        <MenuItem key={menu.id} id={menu.id} {...menu} />
      ))}
    </div>
  );
}

export default MenuList;
